releases/0/tender/description:
In support of their fleets of floating Aids-to-Navigation (AtoNs) and their ongoing statutory duties, the General Lighthouse Authorities for Great Britain (the GLAs) are each users of significant quantities of mooring equipment, including:
      
      Open Link and Stud Link Chain Cable;
      Bridles, including associated swivels and links;
      Shackles, including Kenter and Joining types;
      Sinkers
      
      This Invitation to Tender process addresses the requirements of the GLAs for the next 4 years. The total contract value is estimated to be approximately 2.4m. The total contract length will be a 4 year framework agreement (initial 3 year contract with a 1 year extension). See ITT documentation for further information.
